const getSimilarityData = () => {
	let output = {
		"nodes": [],
		"links": []
	}

	let count = {}

	//looping through each pair
	Object.keys(results).map((pair_key) => {
		let link_ob = {}

		let scores = []
		let weights = []
		Object.values(results[pair_key]["features"]).map((feature) => {
			let internal_scores = []
			let internal_weights = []
			Object.values(feature["score"]).map((score) => {
				internal_scores.push(parseFloat(score))
			})
			Object.values(feature["weight"]).map((weight) => {
				internal_weights.push(parseFloat(weight))
			})
			scores.push(average(internal_scores))
			weights.push(average(internal_weights))
		})

		let edge_weight = 0
		let n = 0
		while (n < scores.length - 1) {
			edge_weight += (scores[n] * weights[n])
			n++
		}

		count[results[pair_key]["pictureA"]] = 0
		count[results[pair_key]["pictureB"]] = 0

		link_ob["source"] = results[pair_key]["pictureA"]
		link_ob["target"] = results[pair_key]["pictureB"]
		link_ob["value"] = edge_weight

		output["links"].push(link_ob)
	})

	output["links"].map((link) => {
		count[link["source"]] = count[link["source"]] + 1
		count[link["target"]] = count[link["target"]] + 1
	})

	Object.keys(count).map((key) => {
		let internal_ob = {}
		internal_ob["id"] = key
		internal_ob["group"] = count[key]
		output["nodes"].push(internal_ob)
	})
	console.log(output)

	return output
}

const Graph = () => {

	const [snapshots, load, err] = useList(firebase.database().ref('/'));

	const svgRef = useRef()

	const drag = (simulation) => {

		const dragstarted = (event) => {
			if (!event.active) simulation.alphaTarget(0.3).restart();
			event.subject.fx = event.subject.x;
			event.subject.fy = event.subject.y;
		}

		const dragged = (event) => {
			event.subject.fx = event.x;
			event.subject.fy = event.y;
		}

		const dragended = (event) => {
			if (!event.active) simulation.alphaTarget(0);
			event.subject.fx = null;
			event.subject.fy = null;
		}

		return d3.drag()
			.on("start", dragstarted)
			.on("drag", dragged)
			.on("end", dragended);
	}

	const chart = (data) => {
		const height = 600
		const width = 600

		const color = () => {
			const scale = d3.scaleOrdinal(d3.schemeCategory10);
			return d => scale(d.group);
		}

		const links = data.links.map(d => Object.create(d));
		const nodes = data.nodes.map(d => Object.create(d));

		const simulation = d3.forceSimulation(nodes)
			.force("link", d3.forceLink(links).id(d => d.id))
			.force("charge", d3.forceManyBody())
			.force("center", d3.forceCenter(width / 2, height / 2));

		const svg = d3.select(svgRef.current)
			.attr("viewBox", [0, 0, width * 2, height * 2]);

		const link = svg.append("g")
			.attr("stroke", "#999")
			.attr("stroke-opacity", 0.6)
			.selectAll("line")
			.data(links)
			.join("line")
			.attr("stroke-width", d => Math.sqrt(d.value));

		const node = svg.append("g")
			.attr("stroke", "#fff")
			.attr("stroke-width", 1.5)
			.selectAll("circle")
			.data(nodes)
			.join("g")

		const circle = node.append("circle")
			.attr("r", 5)
			.attr("fill", color())
			.call(drag(simulation));

		const label = node.append("text")
			.text(d => d.id)
			.attr("font-family", "sans-serif")
			.attr("dy","15")
			.attr("dx","-15")
			.attr("font-size", "10px")
			.attr("fill", "black")
			.attr("stroke","none") 

		node.append("title")
			.text(d => d.id);

		simulation.on("tick", () => {
			link
				.attr("x1", d => d.source.x)
				.attr("y1", d => d.source.y)
				.attr("x2", d => d.target.x)
				.attr("y2", d => d.target.y);

			node
				.attr("transform", (d) => {
					return "translate(" + d.x + "," + d.y + ")";
				})
		});

		return svg.node();
	}

	useEffect(() => {
		chart(getSimilarityData())
	}, [results])

	return(
		<div className="container">
			<h1>Graph</h1>
			<svg ref={svgRef}></svg>
		</div>
	)
}

export default Graph;